package vo;

public class StadiumVo {
	
	int s_idx;
	String s_name;
	String s_addr;
	String s_open;
	String s_seat;
	int o_secondQ;
	String t_name;
	
	
	public StadiumVo() {
		// TODO Auto-generated constructor stub
	}
	
	public int getS_idx() {
		return s_idx;
	}
	public void setS_idx(int s_idx) {
		this.s_idx = s_idx;
	}
	public String getS_name() {
		return s_name;
	}
	public void setS_name(String s_name) {
		this.s_name = s_name;
	}
	public String getS_addr() {
		return s_addr;
	}
	public void setS_addr(String s_addr) {
		this.s_addr = s_addr;
	}
	public String getS_open() {
		return s_open;
	}
	public void setS_open(String s_open) {
		this.s_open = s_open;
	}
	public String getS_seat() {
		return s_seat;
	}
	public void setS_seat(String s_seat) {
		this.s_seat = s_seat;
	}

	public int getO_secondQ() {
		return o_secondQ;
	}

	public void setO_secondQ(int o_secondQ) {
		this.o_secondQ = o_secondQ;
	}

	public String getT_name() {
		return t_name;
	}

	public void setT_name(String t_name) {
		this.t_name = t_name;
	}
	
	
	
	

}
